// [RUN WITH] npm start

import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import { Login } from './Components/Login';
import { Register } from './Components/Register';


function App() {


  return (
    <Router>
      <div>
        <Routes>
          <Route path="/register">
            <Register />
          </Route>
          <Route path="/">
            <Login />
          </Route>
        </Routes>
      </div>
    </Router>
  )
}

export default App
